import React, { Component } from 'react';
import axios from 'axios';


export default class ListTout extends Component {

    constructor(props) {
        super(props);
        this.state = { produit: [] };

    }
    componentDidMount() {
        const idUser = localStorage.id
        axios.get('http://localhost:8080/api/users/newArticle/' + idUser)
            .then(response => {
                console.log('i am a response', response)
                for (let i = 0; i < response.data.length; i++) {
                    if (localStorage.id === response.data[i].idUser) {
                        this.setState({ produit: response.data });
                    }
                  }

            })
            .catch(function (error) {
                console.log(error);
            })



    }

    liste() {
        return <div>
            <img width="400px" height="45px" src="logo.png" alt="pdp" />
        </div>
    }
    render() {
        return (
            <div>
                {this.liste()}
            </div>
        );
    }
}
